long_desc.thetext:
It might be useful to use the following fix

(I believe the element is to add a space just before the anchor, but depending on what is the exact location in which the space is missing please adjust the selector accordingly.)

a.r:before {
    content: "\00a0";
}

Please see the following article on Stack Overflow:

http://stackoverflow.com/questions/5467605/add-a-space-after-an-element-using-after

Here's some html that seems to give you a bit more control:

<html>
<head>
<style type="text/css">
.bg {
  background-color: #ccc;
  padding: 0 4px;
  margin: 0 2px;
}

.space {
  font-size: 0px;
}

</style>
</head>
<body style="background-color: #fff">
<span class="bg">aaaa</span><span class="space">&nbsp;</span><span class="bg">bbb</span><span class="space">&nbsp;</span><span>ccccc</span><br />
</body>
</html>

The &nbsp; completely disappears in Firefox and Chrome because it is in a span set to a 0px font size. (You can see this by removing/commenting the margin setting out. But it's there for conversion to text when copying and pasting into a text editor.

After some prototyping, it appears that using the CSS content property to add a space doesn't work to get that space into a text representation of the HTML. I also discovered that content added in this way ends up becoming part of the the selected tag, and not appended. Thus, if a "cell" has a background color, using this method adds extra space to one side.

If there's a requirement/desire to not change the current HTML, the other option is to use jQuery (or raw javascript if you'd rather) to add the space element.

Here is the above example done in this way:

<html>
<head>
<script type="text/javascript" src="http://ajax.googleapis.com/ajax/libs/jquery/1.7.1/jquery.min.js"></script>

<script type="text/javascript">
(function($) {
  var spacer = $('<span class="space">&nbsp;</span>');
  $(document).ready(function() {
    $(".bg").each(function(i) {
      $(this).after(spacer.clone());
    });
  });
})(jQuery);
</script>

<style type="text/css">
.bg {
  background-color: #ccc;
  padding: 0 4px;
  margin: 0 2px;
}

.space {
  font-size: 0px;
}
</style>
</head>

<body style="background-color: #fff">
<span class="bg">aaaa</span><span class="bg">bbb</span><span>ccccc</span><br />
</body>
</html>
